    public static double[] lerp(double t, double[] a, double[] b) {
        return new double[] {
            a[0] + t * (b[0] - a[0]),
            a[1] + t * (b[1] - a[1])
        };
    }

    public static double[] getValues(double distance) {
        double step = 0.1;
        int n = LUT.length;

        if (distance <= 0) return LUT[0];
        if (distance >= (n - 1) * step) return LUT[n - 1];

        int i = (int)Math.floor(distance / step);
        double t = (distance - i * step) / step;

        return lerp(t, LUT[i], LUT[i + 1]);
    }

